import React from "react";
import { MapList } from "@semapps/geo-components";
import {
  useGetMany,
  useGetOne,
  ResourceContextProvider,
  ListBase,
} from "react-admin";

const Map = () => {
  // console.log(data);
  return (
    <ResourceContextProvider value="Place">
      <ListBase syncWithLocation basePath="/Place">
        <MapList
          latitude={(record) => {
            console.log(record);
            return record?.["pair:hasPostalAddress"]?.["pair:latitude"];
          }}
          longitude={(record) =>
            record?.["pair:hasPostalAddress"]?.["pair:longitude"]
          }
          label={(record) => record?.["pair:label"]}
          description={(record) =>
            record?.["pair:hasPostalAddress"]?.["pair:label"]
          }
          scrollWheelZoom
        />
      </ListBase>
    </ResourceContextProvider>
  );
};
export default Map;
